import React from 'react';



function Navbar() {




    return (
        <>
            <nav class="navigation-bar">
                <img class="logo" src="logo.png"></img>
                <a href="#">Home</a>
                <a href="#">Projects</a>
                <a href="#">About</a>
                <a href="#">Services</a>
                <a href="#">Get in Touch</a>
            </nav>

        </>

    );


}

export default Navbar;
